import React, {useState} from 'react';
import axios from 'axios';

function GetAccountById({userID}) {

    const [data, setdata] = useState({});

    axios.get( 'http://localhost:8080/accounts/' + {userID})
        .then(res=> {
            setdata(res.data);
        })
    return (
        <div>
            <table>
                <th>Firstname</th>
                <th>LastName</th>
                <th>Email</th>
                <th>PhoneNumber</th>
            {data.map(user =>(
                <tr>user.firstname</tr>,
                <tr>user.lastname</tr>,
                <tr> user.email</tr>,
                <tr> user.phoneNumber</tr>)
            )}
            </table>
        </div>
    );
}

export default GetAccountById;
